import { Navbar, Header, Services } from './containers';
import { About, Brands } from './components';

import './App.css';

const brandsObserver = document.querySelectorAll('.brands__container')

const observer = new IntersectionObserver(entries => {
  entries.forEach(entry => {
      entry.target.classList.toggle('slide', entry.isIntersecting)
     //if(entry.isIntersecting) observer.unobserve(entry.target)
      })
  },
      {
          threshold: 0.1
      }
  )

  brandsObserver.forEach(brands__container => {
    observer.observe(brands__container)
    })  

  const App = () => {
  return (
   <div className='malithebrand__center-div'>


   <div className='malithebrand__app-container'>
     <Navbar />
     <Header />
     <Services />
     <About />
     <Brands />


   </div>


   </div>

  );
}


export default App
